  trendPrediction(list, targetTime) {
    if (list.length <= 5) {
      return {
        result: false,
        reason: 'LAST VALUES LESS THEN 5',
        value: { list },
      };
    }

    let firstOpen = 0;
    let minValue = 100000000000000;
    let minTime;
    let maxTime;
    let maxValue = -1;
    let avgValue = 0;
    let totalCount = 0;
    let totalValue = 0;
    for (let index = 0; index < list.length; index++) {
      const data = list[index];

      if (index == 0) firstOpen = data.openValue;
      totalCount++;

      const open = data.openValue;
      const close = data.closeValue;
      totalValue += close;
      const time = new Date(data.time);
      if (open < minValue) {
        minValue = open;
        minTime = time;
      }
      if (close < minValue) {
        minValue = close;
        minTime = time;
      }
      if (open > maxValue) {
        maxValue = open;
        maxTime = time;
      }
      if (close > maxValue) {
        maxValue = close;
        maxTime = time;
      }

      if (index == list.length - 1 || time == targetTime) {
        // Risky first session
        const currentHour = time.getHours();
        if (currentHour == 9) {
          const currentMinute = time.getMinutes();
          if (currentMinute <= 20) {
            return {
              result: false,
              reason: 'RISKY FIRST SESSION',
              value: { currentHour, currentMinute },
            };
          }
        }

        // Risky last session
        if (currentHour >= 14)
          return {
            result: false,
            reason: 'RISKY LAST SESSION',
            value: { currentHour },
          };

        // DIFFERENCE TO OPEN TOO LOW
        const diffToOpen = (close * 100) / open - 100;
        if (diffToOpen <= 0.025) {
          return {
            result: false,
            reason: 'DIFFERENCE TO OPEN TOO LOW',
            value: { diffToOpen, open, close },
          };
        }

        // DIFFERENCE TO FIRST OPEN TOO LOW
        const diffToFirstOpen = (close * 100) / firstOpen - 100;
        if (diffToFirstOpen <= 1.5) {
          return {
            result: false,
            reason: 'DIFFERENCE TO FIRST OPEN TOO LOW',
            value: { diffToFirstOpen },
          };
        }

        // DIFFERENCE TO MINIMUM TOO LOW
        const diffToMin = (close * 100) / minValue - 100;
        if (diffToMin <= 2) {
          return {
            result: false,
            reason: 'DIFFERENCE TO MINIMUM TOO LOW',
            value: { diffToMin },
          };
        }

        // DIFFERENCE TO MAX TOO FLUCTUATE
        const diffToMax = (close * 100) / maxValue - 100;
        if (diffToMax <= -1 || diffToMax >= 25) {
          return {
            result: false,
            reason: 'DIFFERENCE TO MAX TOO FLUCTUATE',
            value: { diffToMax },
          };
        }

        // MIN STILL DOMINATING
        const diffMinToMax = (maxValue * 100) / minValue - 100;
        if (diffMinToMax <= 1) {
          return {
            result: false,
            reason: 'MIN STILL DOMINATING',
            value: { diffToMax },
          };
        }

        // NO ENOUGH SPIKE WITH BASE OF AVG
        avgValue = totalValue / totalCount;
        const diffToAvg = (close * 100) / avgValue - 100;
        if (diffToAvg < 2.5) {
          return {
            result: false,
            reason: 'NO ENOUGH SPIKE WITH BASE OF AVG',
            value: { diffToMax },
          };
        }

        return {
          result: true,
          firstOpen,
          close,
          diffToFirstOpen,
          time: time.toString(),
        };
      }
    }
  }
